	props.startPosition = startPosition;
	props.labels = {intro:0,gotexto1:1,texto1:42,gotexto2:43,texto2:190,gotexto3:191,texto3:295,actividad1:305,actividad2:351,actividad3:393,cc:429,creditos:430,mapa:431};
