	this.frame_0 = function() {
		var primerCuadro = this;
		primerCuadro.stop();
		
		if(escena==="intro"){
			primerCuadro.gotoAndStop('intro');
		}else if(escena==="actividad1"){
			primerCuadro.gotoAndStop('texto3');
		}else if(escena==="actividad2"){
			primerCuadro.gotoAndStop('texto3');
		}else if(escena==="actividad3"){
			primerCuadro.gotoAndStop('texto3');
		}else{
			primerCuadro.stop();
		}
		
		
		
		
		let soundInstanceIntro = null;
		
		// Al hacer clic en PlayButton, registra y carga el sonido si no lo ha hecho aún, luego reproduce el sonido
		primerCuadro.introAudioBtn.addEventListener("click", function() {
		    if (soundInstanceIntro) {
		        soundInstanceIntro.play();
				primerCuadro.eq_audio.alpha=1;
				primerCuadro.stopIntroBtn.x=273,7;
				primerCuadro.stopIntroBtn.y=194,9;
				primerCuadro.introAudioBtn.x=-5000;
				primerCuadro.introAudioBtn.y=-5000;
				primerCuadro.next1.alpha=0;
		    } else {
		        createjs.Sound.registerSound({src:"sounds/introAudio.mp3", id:"introAudio"});
		        createjs.Sound.on("fileload", loadHandler, this);
				primerCuadro.eq_audio.alpha=1;
				primerCuadro.stopIntroBtn.x=273,7;
				primerCuadro.stopIntroBtn.y=194,9;
				primerCuadro.introAudioBtn.x=-5000;
				primerCuadro.introAudioBtn.y=-5000;
				primerCuadro.next1.alpha=0;
		    }
		});
		
		function loadHandler(event) {
		    // Asigna el sonido a soundInstance y luego lo reproduce
		    soundInstanceIntro = createjs.Sound.createInstance("introAudio");
		    soundInstanceIntro.play();
			primerCuadro.eq_audio.alpha=1;
			primerCuadro.stopIntroBtn.x=273,7;
			primerCuadro.stopIntroBtn.y=194,9;
			primerCuadro.introAudioBtn.x=-5000;
			primerCuadro.introAudioBtn.y=-5000;
			primerCuadro.next1.alpha=0;
		}
		
		// Al hacer clic en StopButton, detén el sonido
		primerCuadro.stopIntroBtn.addEventListener("click", function() {
		    if (soundInstanceIntro) {
		        soundInstanceIntro.stop();
				primerCuadro.eq_audio.alpha=0;
				primerCuadro.stopIntroBtn.x=-5000;
				primerCuadro.stopIntroBtn.y=-5000;
				primerCuadro.introAudioBtn.x=273,7;
				primerCuadro.introAudioBtn.y=194,9;
				primerCuadro.next1.alpha=1;
		    }
		});
		
		primerCuadro.next1.on('click', function(){
			primerCuadro.eq_audio.alpha=0;
			primerCuadro.gotoAndPlay('gotexto1');
		});
	}
